clear all

%S is the summary
%D is the data, all the points

Req_length=20;
Tolerance=4;



[S,D]=data();

Cells=cell(10,1); %A 2D matrix would do, or a list of cells
%Temp_Cell=zeros(1000,1);
Checked_points=zeros(size(D,1),1);
Frame_points=cell(size(S,1),1);
End_points=zeros(size(S,1),1);
Frame_list=zeros(size(D,1),1);

p=1;%point
p2=0;%end point

%Make a list of the points from different frames

for i=1:size(S,1)
    if S(i,2) == 0
        Frame_points{i}=[0:0];
    else
        p2=p2+S(i,2);
        Frame_points{i}=[p:p2];
        End_points(i)=p2;
        p=p+S(i,2);
    end
end
    
p=0;
for i=1:size(S,1)
     for j=1:S(i,2)
         p=p+1;
         Frame_list(p)=(i);
     end
end

%Go thru all the points and check if they're connected within tolerance

cell_num=1;

for i=1:size(D,1)
    if Checked_points(i)==0
        still_checking=1;
        point=[i D(i,3) D(i,4) Frame_list(i)];
        temp_cell(1,:)=point;
        while still_checking>0;
            %Get the next frame
            Checked_points(point(1))=1;
            cur_fr=Frame_list(point(1));
            nex_fr=cur_fr+1;
            Sol=0;
            if Frame_points{nex_fr}~=0
                [Sol,new_point] = find_point(point(2),point(3),D(Frame_points{nex_fr},:),Tolerance);
            end
            if Sol==1
                point=[new_point D(new_point,3) D(new_point,4) Frame_list(new_point)];
                still_checking=still_checking+1;
                temp_cell(still_checking,:)=point;
            else
                still_checking=0;
            end
        end
        if still_checking==0 && size(temp_cell,1)>Req_length
            Cells{cell_num}=temp_cell;
            cell_num=cell_num+1;
            temp_cell=[];
        elseif still_checking==0
            temp_cell=[];
        end
    end
end

figure
hold on
%Plot all the cells
for i=1:size(Cells,1)
    line(Cells{i}(:,2),Cells{i}(:,3),Cells{i}(:,4));
end





function [Sol,new_point] = find_point(X,Y,list,tolerance)
Sol=0;
new_point=0;
%num,area,x,y
for i=1:size(list,1)
    if abs(X-list(i,3))<4 && abs(Y-list(i,4))<4
% [X list(i,3)]
% [Y list(i,4)]
        new_point=list(i,1);
        Sol=1;
        return
    end
end
end


